import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h2>Welcome to the Home Page!</h2>
      <p>This is the main page of your application.</p>
      <Link to="/about">Go to About Page</Link>
    </div>
  );
}

export default Home;
